  { :id => 3, :name => "Calculus", :subject => nil, :author => "James Stewart", :edition => nil, :price => nil, :googleId => "EBE3vMmGu50C", :thumbnail => "http://bks9.books.google.com/books?id=EBE3vMmGu50C&printsec=frontcover&img=1&zoom=1&imgtk=AFLRE72GTuXzPzIvpqwLneZYGEs16CNptmwojFLQwCMBku556aYN8GelQgtA8-PRp9V5tfF4kIlV-UvoBndA9Nk9Jrdt8j5HhtLSXvFQt0HnW1bMTzb_-FA&source=gbs_api", :created_at => "2013-11-13 19:01:21", :updated_at => "2013-11-13 19:01:21", :isbn => "0495383627", :published => "2009", :description => "Success in your calculus course starts here! James Stewart's CALCULUS texts are world-wide best-sellers for a reason: they are clear, accurate, and filled with relevant, real-world examples. With CALCULUS, International Metric Sixth Edition, Stewart conveys not only the utility of calculus to help you develop technical competence, but also gives you an appreciation for the intrinsic beauty of the subject. His patient examples and built-in learning aids will help you build your mathematical confidence and achieve your goals in the course!" },
