  { :id => 5, :name => "Explaining Physics", :subject => nil, :author => "Stephen Pople", :edition => nil, :price => nil, :googleId => "WEJjhXierpAC", :thumbnail => "http://bks7.books.google.com/books?id=WEJjhXierpAC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE70wjvJ6CadhVrbb5kOQWfC0uG4Q3gEZ0DG_IA1JfiEPqKjVEr9TW0TidOdSQ5W2EqJ_6mGKGTfSsfLsu8VhxctZBEAGVvO_66D5f76MNUgetKyrdro&source=gbs_api", :created_at => "2013-11-13 19:11:35", :updated_at => "2013-11-13 19:11:35", :isbn => "0199142726", :published => "1987", :description => "Explaining Physics emphasizes the applications and social effects of physics, and extends its treatment of energy and electronics.· Introductory page to each unit to bring out the relevance of the material to everyday life· Simple questions at the end of each unit to consolidate learning· Helpful revision summary" },
