  { :id => 7, :name => "The Hunger Games", :subject => nil, :author => "Suzanne Collins", :edition => nil, :price => nil, :googleId => "hlb_sM1AN0gC", :thumbnail => "http://bks6.books.google.com/books?id=hlb_sM1AN0gC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE71_Q_kYdE694gslqqHanbJ_HR9nccfzcv6gvZgwgatfcx4zpC4Pg9dABG5OIa-5COM4lAWyps309iIe0yyknLaLnbjFFOHG_jELkB5uQXYTxYBtQZo&source=gbs_api", :created_at => "2013-11-13 19:36:19", :updated_at => "2013-11-13 19:36:19", :isbn => "0439023521", :published => "2008", :description => "Now in paperback, the book no one can stop talking about . . .<br> <br> In the ruins of a place once known as North America lies the nation of Panem, a shining Capitol surrounded by twelve outlying districts. The Capitol is harsh and cruel and keeps the districts in line by forcing them all to send one boy and one girl between the ages of twelve and eighteen to participate in the annual Hunger Games, a fight to the death on live TV. Sixteen-year-old Katniss Everdeen, who lives alone with her mother and younger sister, regards it as a death sentence when she is forced to represent her district in the Games. But Katniss has been close to dead (cont'd)" },
  { :id => 8, :name => "Games and Gaming", :subject => nil, :author => "Larissa Hjorth", :edition => nil, :price => nil, :googleId => "ByXtntNKFL4C", :thumbnail => "http://bks6.books.google.com/books?id=ByXtntNKFL4C&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE73fAdCVfypccmviHecP9UApNWBjLgh9yXxTqPbpVSx1WjFE32GZeFAYRZkYNJCVrysywV9qpqLbVrEaVQ8wnnz_njY4xd5sBmTDW5hRJMMsrs3O1rQ&source=gbs_api", :created_at => "2013-11-13 19:36:24", :updated_at => "2013-11-13 19:36:24", :isbn => "184788492X", :published => "2011-02-15", :description => "The computer games industry has rapidly matured. Once a preoccupation only of young technophiles, games are now one of the dominant forms of global popular culture. From consoles such as Nintendo Wii and Sony Xbox to platforms such as iPhones and online gaming worlds, the realm of games and their scope has become all-pervasive. The study of games is no longer a niche interest but rather an integral part of cultural and media studies. The analysis of games reveals much about contemporary social relations, online communities and media engagement. Presenting a range of approaches and analytical tools through which to explore the role of games in everyday life, and packed with case material, <i>Games and Gaming</i> provides a comprehensive overview of this new media and how it permeates global culture in the twenty-first century." },
  { :id => 9, :name => "Games for Children", :subject => nil, :author => "Gordon Lewis", :edition => nil, :price => nil, :googleId => "jRncjEnymlsC", :thumbnail => "http://bks7.books.google.com/books?id=jRncjEnymlsC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE73rxPDM0rFqmTBzFx_bnnqxvv-4Yh4mnAyZQBiocBQAjx9mkkRlsCqvoutxyxvEB6iPMvua5JEqNyWV2dgAt8om38hkG0YeH271MxX_NyljxGSBEcs&source=gbs_api", :created_at => "2013-11-13 19:37:06", :updated_at => "2013-11-13 19:37:06", :isbn => "0194372243", :published => "1999-09-20", :description => "A fresh and enjoyable collection of games for children aged between 4 and 11, including card games, board games, physical games, and co-operative and competitive games. Gives helpful guidance for teachers on integrating games into the English syllabus, classroom management, adapting traditional games, and creating new games with children." },
  { :id => 10, :name => "How Not to Kill Your Baby", :subject => nil, :author => nil, :edition => nil, :price => nil, :googleId => "Jx4LK_ojZ_4C", :thumbnail => "http://bks8.books.google.com/books?id=Jx4LK_ojZ_4C&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE721mvBwWKjmZoJXwqhL-tP7_rW-6BMEJPyio1eqnq6bLkEjN4HhqDdh9Ei1b96i2986btY0TObJUaMvSBJv7ScZOlTYYIxB--3xhJ70VhwQCFe3TjM&source=gbs_api", :created_at => "2013-11-14 05:36:02", :updated_at => "2013-11-14 05:36:02", :isbn => "1449410391", :published => "2012-03-20", :description => "<p>Have you ever read a parenting book that left you feeling inadequate and/or terrified? In other words, have you ever read any parenting book whatsoever?</p><p>If so, you need <i>How Not To Kill Your Baby</i>, a hilarious parody of every fear-mongering, crazy-making pregnancy and parenting manual you've ever cringed over. Just consider the following advice:</p><p>* As you know if you have ever seen someone give birth in a movie or television show, all newborns emerge with adorable round faces, pudgy limbs, and twinkling eyes. If, by contrast, the nurse hands you a tiny, squawling creature with the face of an old man and skin covered in goo, hand it back immediately. There has clearly been some sort of mixup with a nearby ward for senile midgets.</p><p>* It's essential that you keep careful track of your baby's every bodily function. That way, when she is president of the United States and a paranoid-minded conspiracy movement springs up denying her eligibility for the position, you will have documentary proof that she did, in fact, poop on U.S. soil at 8:23AM on February 23.</p><p>* When choosing a nursery school, make sure to visit first, and ask the teachers about their educational philosophies. Then ask about their criminal records. If they insist they have none, you may need to keep asking, perhaps while shining a bright light in their face. Also, take their fingerprints, then follow them home from a discreet distance and go through their trash. Oh, and don't forget to thank them for their dedication to helping the young!</p><p>* It is easy to adjust your parenting techniques as your children grow: simply do and say the exact same things, but raise your voice by one decibel for every year of your child's age.</p><p><i>How Not To Kill Your Baby</i> is printed on child-safe, 100% piranha-free paper, and bound without the use of exploding staples. You'll get no such promise from <i>What To Expect When You're Expecting</i>.</p><p><i>How Not To Kill Your Baby</i> is the book for you... unless you're some kind of baby-hating creep who wants to parent all wrong.</p>" },
  { :id => 11, :name => "Google Inc. Services - Google Tools - What is Google?", :subject => nil, :author => "Heinz Duthel", :edition => nil, :price => nil, :googleId => "gQXKaf8azXQC", :thumbnail => "http://bks4.books.google.com/books?id=gQXKaf8azXQC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE73gBGleaHHhUPCrdyYPiO6ZTesSuM3zttrTgI0_rmdHUXePIIIfGKZ2WnRd9AbTbPjw-AKH_b7vlbE6wI4TyT8UxczF6-dD6oqu2bLecyWS5SBDiSk&source=gbs_api", :created_at => "2013-11-14 05:36:31", :updated_at => "2013-11-14 05:36:31", :isbn => "1409218104", :published => "2008-08-08", :description => "Google HistoryGoogle TimelineGoogle Search Engine PrototypeGoogle's Business PrinciplesGoogle's TechnologyHelp with Searching Google and Search FeaturesGoogle in different Languages and CountriesYou love Google? The read this book.You use Google? Then read this book.You hate Google? The read this book.You don't know Google? Then read this book!You want to learn from the no. 1 on the Internet, Google, Inc. - then read this book...You believe you are a Webmaster? Then first read this book.You want to become a SEO Pro? Then read this book....Why Google? What is Google? What is about the story with NSA and Google?What Google wants from you?\" About 30% of the 1.4 billion unique documents on the web are rubbish \"" },
  { :id => 12, :name => "The Art of the Last of Us", :subject => nil, :author => "Naughty Dog Studios", :edition => nil, :price => nil, :googleId => "R1GilwEACAAJ", :thumbnail => "http://bks1.books.google.com/books?id=R1GilwEACAAJ&printsec=frontcover&img=1&zoom=1&imgtk=AFLRE71T7ZgVFhloiZcFSk76aEDosOWMk0ZH2llWX32vUkrcmRHfI_0BjpMLOQ-VLgHqX1p3_0L-K9Rns8HWxIDFRGMLqs3arZN4uZGdBP4RP432c-fYdx8&source=gbs_api", :created_at => "2013-11-14 05:45:16", :updated_at => "2013-11-14 05:45:16", :isbn => "161655164X", :published => "2013-05-21", :description => "Naughty Dog Studios and Dark Horse proudly present the essential companion to The Last of Us, a richly detailed and compelling game set in a post-pandemic world where humans have become an endangered species. Featuring concept art, character designs, and astonishing settings and landscapes, The Art of The Last of Us provides a unique look at one of the gaming world's most eagerly anticipated titles." },
  { :id => 13, :name => "The Last Stand of Fox Company", :subject => nil, :author => "Bob Drury, Thomas Clavin", :edition => nil, :price => nil, :googleId => "lwPNzOiYQZQC", :thumbnail => "http://bks4.books.google.com/books?id=lwPNzOiYQZQC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE70pXsD-J6QTtU0NtvPltfD76OaORWq1umQ9-4_3BSoAFdegE1spqcI1NXXSdOCVHnLVaCNGbUrqYkUEM1_-572lYboIU_MDd_JGUhxK9ZgU18wOpDA&source=gbs_api", :created_at => "2013-11-14 05:45:19", :updated_at => "2013-11-14 05:45:19", :isbn => "0871139936", :published => "2009-01-01", :description => "November 1950, the Korean Peninsula: After General MacArthur ignores Mao’s warnings and pushes his UN forces deep into North Korea, his 10,000 First Division Marines find themselves surrounded and hopelessly outnumbered by 100,000 Chinese soldiers near the Chosin Reservoir. Their only chance for survival is to fight their way south through the Toktong Pass, a narrow gorge that will need to be held open at all costs. The mission is handed to Captain William Barber and the 234 Marines of Fox Company, a courageous but undermanned unit of the First Marines. Barber and his men climb seven miles of frozen terrain to a rocky promontory overlooking the pass, where they will endure four days and five nights of nearly continuous Chinese attempts to take Fox Hill. Amid the relentless violence, three-quarters of Fox’s Marines are killed, wounded, or captured. Just when it looks like the outfit will be overrun, Lt. Colonel Raymond Davis, a fearless Marine officer who is fighting south from Chosin, volunteers to lead a daring mission that cuts a hole in the Chinese lines and relieves the men of Fox. This is a fast-paced and gripping account of heroism and sacrifice in the face of impossible odds." },
  { :id => 14, :name => "Hamsters", :subject => nil, :author => "Sue Fox", :edition => nil, :price => nil, :googleId => "fUpoLAAACAAJ", :thumbnail => "http://bks7.books.google.com/books?id=fUpoLAAACAAJ&printsec=frontcover&img=1&zoom=1&imgtk=AFLRE70PbXf_LnII2AKvftz2mbA24Zehf05LkxCyqVlFIfvE9WZ-N9m6PCZROUHiES9hUHSg7xVu5bPEEKOHXRDaffoZR9WciT3gJt0oTVXUJiypzSqQ-94&source=gbs_api", :created_at => "2013-11-14 05:47:01", :updated_at => "2013-11-14 05:47:01", :isbn => "1842861832", :published => "2008-07", :description => "Hamsters are among the most popular pocket pets in the world, especially for children. Aside from their charming looks and amusing antics, these small animals make ideal family pets because they are quiet, take up little space, and are easy to care for with the right information at hand. Hamsters will cover everything you need to know to ensure a long and happy life for your new pet, including expert advice on housing, feeding, health care and training tips that will keep both pet and keeper entertained. Each book in this series contains original, lively text, complete with informative tips and colourful photos illustrating all aspects of pet care. Expertly written these user-friendly guides are bound to delight the entire family" },
  { :id => 15, :name => "The American Roller Coaster", :subject => nil, :author => "Scott Rutherford", :edition => nil, :price => nil, :googleId => "NoeG5n87dWQC", :thumbnail => "http://bks2.books.google.com/books?id=NoeG5n87dWQC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE73Y-DsXsZBu7ofWEV0dabV9m6LOTPTMgmE3Ss_wYBPhc_59EZ9SYt2iAftThmcumdsWgEzQL3skzR4ux7ZbqLldNIAQhczVWHoCEmm8y6nqvoWs0-I&source=gbs_api", :created_at => "2013-11-14 05:47:15", :updated_at => "2013-11-14 05:47:15", :isbn => "0760319294", :published => "2004-07", :description => "Step right up to the magic of the great coasters as you travel through roller coaster history from their beginnings up through today! Experience the early roots of coastering in the mid-1800s and the emergence of grand amusement parks in the 1880s. Flash back to the golden age of coasters between 1900 and 1930, and witness the thrill rides' historic decline in the 1960s. Ride these radical rails in chapters chronicling coaster designers, manufacturing companies, technology, and special coasters.About the AuthorScott Rutherford developed an intense love of amusement parks and roller coasters at a very young age when he roade his first major wooden roller coaster at Cincinnati's famed Coney Island in 1970. A charter member of the American Coaster Enthusiasts, a club for roller coaster fans, he was awarded an honorary membership while serving as editor of ACE News and contributing to ACE's RollerCoaster! magazine. Scott lives in Charlotte, North Carolina, where he currently serves as East Coast Bureau Chief of Amusement Today, a high-profile monthly trade publication focusing on the leisure/entertainment industry." },
  { :id => 16, :name => "Cooking", :subject => nil, :author => "James Peterson", :edition => nil, :price => nil, :googleId => "lRrZI9F9YEIC", :thumbnail => "http://bks3.books.google.com/books?id=lRrZI9F9YEIC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE70KcbY4DuFv8zfTIyctIDtLXOTBQPObV6LIkF7lcWazQQV_-muMvKc4ccselphAxB5YF9NG1iBAeXdxJlQq_MpSVxzqu8C-2GPoW3Rf9NmNkLgWA6M&source=gbs_api", :created_at => "2013-11-14 06:02:21", :updated_at => "2013-11-14 06:02:21", :isbn => "1607744066", :published => "2012-04-10", :description => "In an era of outfitted home kitchens and food fascination, it's no wonder home cooks who never learned the fundamentals of the kitchen are intimidated. Twenty years ago, James Peterson could relate, and so he taught himself by cooking his way through professional kitchens and stacks of books, logging the lessons of his kitchen education one by one. Now one of the country's most revered cooking teachers, Peterson provides the confidence-building instructions home cooks need to teach themselves to cook consistently with ease and success. COOKING is the only all-in-one instructional that details the techniques that cooks really need to master, teaches all the basic recipes, and includes hundreds of photos that illuminate and inspire. <br><br>   • Cooking authority James Peterson's definitive, all-inclusive learn-to-cook cookbook. <br>   • 600 hard-working recipes everyone should know how to make-from the perfect roasted chicken to bouillabaisse and apple pie. <br>   • 1,500 instructional photos, showing exactly how recipes are made, teach food-literate novices to cook with confidence and more advanced cooks to expand their repertoire.<br>   • James Peterson has more than 1 million cookbooks in print.<br><br><br><i>From the Hardcover edition.</i>" },
  { :id => 17,  :name => "The Physics Book", :subject => nil, :author => "Clifford A. Pickover", :edition => nil, :price => nil, :googleId => "B9KnuAAACAAJ", :thumbnail => "http://bks3.books.google.com/books?id=B9KnuAAACAAJ&printsec=frontcover&img=1&zoom=1&imgtk=AFLRE73OOHmEDo__was2Ir6YywjImq17DQWlapu7zNmsA_ik53svvZ98YHeIGIz8OTrhL6llpI08Nm9jkrGLn_aDy20gYfyYAxz3QJPb4sSbRS-3XJ8Lt8U&source=gbs_api", :created_at => "2013-11-14 06:02:36", :updated_at => "2013-11-14 06:02:36", :isbn => "1402778619", :published => "2011", :description => "Following the hugely successful <i>The Science Book</i> and <i>The Math Book</i> comes a richly illustrated chronology of physics, containing 250 short, entertaining, and thought-provoking entries. In addition to exploring such engaging topics as dark energy, parallel universes, the Doppler effect, the God particle, and Maxwell's demon, the book's timeline extends back billions of years to the hypothetical Big Bang and forward trillions of years to a time of “quantum resurrection.” Like the previous titles in this series, <i>The Physics Book</i> helps readers gain an understanding of major concepts without getting bogged down in complex details. <br>  " },
  { :id => 18, :name => "The Works of Shakespear", :subject => nil, :author => "William Shakespeare, Alexander Pope", :edition => nil, :price => nil, :googleId => "wsPe-P8lb8AC", :thumbnail => "http://bks6.books.google.com/books?id=wsPe-P8lb8AC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE71_oBj63DlLrD50zFjnC1unyuK92ADUN1pZTcrv_tXBmEek7tYDYcxgoe53WmgJqisXiRIFvmwG89GlqNqAE3wOH2hehEJ9pkNPYU2uq8WTonC33nw&source=gbs_api", :created_at => "2013-11-14 07:22:56", :updated_at => "2013-11-14 07:22:56", :isbn => nil, :published => "1747", :description => nil },
  { :id => 19, :name => "Physics", :subject => nil, :author => "Aristotle", :edition => nil, :price => nil, :googleId => "zd6xl3pmiWoC", :thumbnail => "http://bks0.books.google.com/books?id=zd6xl3pmiWoC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE711J-E5DtLt9ksE-rUvLAAnKjNA_NlVD4iw-W0A4T1zLpSQhy_BDwa891HEdtdEst6E8GaKdrS1Anpkpgz-Qnb6GbVY29jsAZtISH5uuEU3sWpCxHk&source=gbs_api", :created_at => "2013-11-14 07:23:43", :updated_at => "2013-11-14 07:23:43", :isbn => "1595470549", :published => "2004-01-01", :description => "Aristotle's works have influenced science, religion, and philosophy for nearly two thousand years. He could be thought of as the father of logical thought. Aristotle wrote: \"There is nothing in the intellect that was not first in the senses.\" He wrote that everything that is learned in life is learned through sensory perception. Aristotle was the first to establish the founding principle of logic. The great writer Dante called Aristotle \"the Master of those who know.\" The Roman writer Cicero viewed Aristotle's work so highly that he called them \"A river of gold.\" \"Again does it follow that being if one is motionless? Why should it not move, the whole of it, within itself as parts of it do which are unities; e.g., this water.\" Please Note: This book is easy to read in true text, not scanned images that can sometimes be difficult to decipher. The Microsoft eBook has a contents page linked to the chapter headings for easy navigation. The Adobe eBook has bookmarks at chapter headings and is printable up to two full copies per year." },
  { :id => 20, :name => "Old Possum's Book of Practical Cats", :subject => nil, :author => "T.S. Eliot", :edition => nil, :price => nil, :googleId => "CcM4H6eswCUC", :thumbnail => "http://bks8.books.google.com/books?id=CcM4H6eswCUC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE714bZ9ZL32veLW-ss9Dl4Kd-2utdzv7ftRCuNzD__CYI-ptNai1PCZEqvN7Ej-R1o9Lvzgy0mT4z2ZObGJU2tBjvMuOVJ-E9xkNJ14txl5X_sz1e1k&source=gbs_api", :created_at => "2013-11-14 08:21:26", :updated_at => "2013-11-14 08:21:26", :isbn => "0571294243", :published => "2012-04-12", :description => "<p><b>Cats! Some are sane, some are mad and some are good and some are bad.</b></p><p><b></b></p><p><b>Meet magical Mr Mistoffelees, sleepy Old Deuteronomy and curious Rum Tum Tugger. But you'll be lucky to meet Macavity because <i>Macavity's not there</i>!</b></p><p></p><p>In 1925 T.S. Eliot became co-director of Faber & Faber, who remain his publishers to this day. Throughout the 1930s he composed the now famous poems about Macavity, Old Deuteronomy, Mr Mistoffelees and many other cats, under the name of 'Old Possum'. In 1981 Eliot's poems were set to music by Andrew Lloyd Webber as <i>Cats</i> which went on to become the longest-running Broadway musical in history. </p><p></p><p>This new edition, published on the 70th anniversary of the book and on the 80th anniversary of Faber & Faber, contains original colour illustrations by the award-winning illustrator of <i>The Gruffalo</i>, Axel Scheffler.</p>" },
  { :id => 21, :name => "How to Tell If Your Cat Is Plotting to Kill You", :subject => nil, :author => "The Oatmeal", :edition => nil, :price => nil, :googleId => "CU8QdXCRmAwC", :thumbnail => "http://bks7.books.google.com/books?id=CU8QdXCRmAwC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE72VASJa4TVAv0tdu7vKrm4s0uG0rwBmMkBZjz8gV90VX0uVLi1vo5d-WIucLmoTAml7cITSHBD8OKM5MfyFIj1prv2XyilUOqA608GzMXiAmBr02Jo&source=gbs_api", :created_at => "2013-11-14 08:21:46", :updated_at => "2013-11-14 08:21:46", :isbn => "1449410243", :published => "2012-10-09", :description => "TheOatmeal.com’s most popular cat jokes, including “How to Pet a Kitty” and “The Bobcats,” plus 15 new and never-before-seen catthemed comics, are presented in this hilarious collection from <i>New York Times</i> best-selling author Matthew Inman, a.k.a. TheOatmeal.com. Includes pull-out poster!<p>Jesus Rollerblading Christ--another helping of TheOatmeal! Mrow, MOAR kitty comics. Mr. Oats delivers a sidesplitting serving of cat comics in his new book, <i>How to Tell If Your Cat Is Plotting to Kill You</i>.<p>If your cat is kneading you, that's not a sign of affection. Your cat is actually checking your internal organs for weakness. If your cat brings you a dead animal, this isn't a gift. It's a warning. <i>How to Tell If Your Cat Is Plotting to Kill You</i> is a hilarious, brilliant offering of cat comics, facts, and instructional guides from the creative wonderland at TheOatmeal.com.<p><i>How to Tell If Your Cat Is Plotting to Kill You</i> presents fan favorites, such as \"Cat vs. Internet,\" \"How to Pet a Kitty,\" and \"The Bobcats,\" plus 17 brand-new, never-before-seen cat jokes. This Oatmeal collection is a must-have from Mr. Oats! A pullout poster is included at the back of the book." },
  { :id => 22, :name => "Harry Potter and the Order of the Phoenix", :subject => nil, :author => "J.K. Rowling", :edition => nil, :price => nil, :googleId => "zpvysRGsBlwC", :thumbnail => "http://bks3.books.google.com/books?id=zpvysRGsBlwC&printsec=frontcover&img=1&zoom=1&imgtk=AFLRE72hI7y4YLZu_JO_DZVBFD4K2fnaK1hya51SAWEYPzIp_mKn3YN8rXVswslUfOsLncpL4sG6lCqAXhuDaMRJS1uq-sHpgvYV9f60x_PicMDciPsz3YM&source=gbs_api", :created_at => "2013-11-14 09:17:26", :updated_at => "2013-11-14 09:17:26", :isbn => "1781100314", :published => "2012-03-27", :description => "In Harry Potter and the Order of the Phoenix, Lord Voldemort has returned to the Wizarding world, presenting a threat that neither the magical government nor the authorities at Hogwarts can stop. In response to his reappearance, Dumbledore reactivates the Order of the Phoenix, a secret society which works to defeat the Dark Lord's minions and protect his targets—especially Harry Potter. But Harry doesn’t want to be protected. Even as the Ministry of Magic denies his claims, The Daily Prophet discredits him, and even Dumbledore won’t look him in the eye, Harry grows more and more determined to fight his lifelong enemy Voldemort—if only he had the “weapon” the Order is guarding. In the meantime, he visits his godfather at his ghoulish London home, Grimmauld Place, and learns more about Voldemort’s deep reach into Wizarding history and the Wizarding world. Back at Hogwarts, Harry must deal with a Defense Against the Dark Arts teacher with a personality like poisoned honey; a surprising new member of the Gryffindor Quidditch team; the possibility of his first real romance; and the looming nightmare of the Ordinary Wizarding Level exams. He’s haunted by dreams of a heavy door at the end of a silent corridor, and a vision of his father and the young Severus Snape that changes everything he thought he knew about them. Even the joy of working with \"Dumbledore's Army\" -a group of Hogwart's students dedicated to defeating Voldemort- can't dispel the gathering darkness. Soon Harry will discover the true depth and strength of his friends; their boundless loyalty and unbearable sacrifices. His fate depends on them all." },
  { :id => 23, :name => "The Great Gatsby", :subject => nil, :author => "F.Scott Fitzgerald", :edition => nil, :price => nil, :googleId => "JgxOs2GX86AC", :thumbnail => "http://bks2.books.google.com/books?id=JgxOs2GX86AC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE73aDbjcY1Bgq9bGsP4p6_GvscPUcul4lb0xMpgmJSFl7u-8jzOc-96ix0BCR24vQ5tbWiji8UcdfHzb5k34ugjQQnY2HOCpMz7mVjqgSBa94_oRKEY&source=gbs_api", :created_at => "2013-11-15 06:07:50", :updated_at => "2013-11-15 06:07:50", :isbn => "1907832564", :published => "2012-02-14", :description => "Amidst prosperity of the 1920s in New York we see a portrait of the Jazz Age, with its decadence and excess. This novel is considered Fitzgerald 's best work and captures the spirit of the author's generation.  A love story and a cautionary tale about the American Dream ingrained in Gatsby's journey to happiness, this story presents a fine example of 20th century American writing." },
  { :id => 24, :name => "Lord of the Flies", :subject => nil, :author => "William Golding", :edition => nil, :price => nil, :googleId => "2wNNMdkaB34C", :thumbnail => "http://bks9.books.google.com/books?id=2wNNMdkaB34C&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE72OzeFlIzTYRuHVB5gAVwsLaIWs0NXmEMfyJKK6PLu2v-z951v8Gdw4FOKEkwaAUInxBHZ20hAs6Cj3N68Xc-G2TiBoSmuEkKGIgj1FQLDTHGYdqY4&source=gbs_api", :created_at => "2013-11-15 06:08:01", :updated_at => "2013-11-15 06:08:01", :isbn => "1101158107", :published => "1959-07-27", :description => "<b>Before <i>The Hunger Games</i> there was <i>Lord of the Flies</i><br> <br> Lord of the Flies</b> remains as provocative today as when it was first published in 1954, igniting passionate debate with its startling, brutal portrait of human nature. Though critically acclaimed, it was largely ignored upon its initial publication. Yet soon it became a cult favorite among both students and literary critics who compared it to J.D. Salinger's <b>The Catcher in the Rye</b> in its influence on modern thought and literature.<br> <br> Labeled a parable, an allegory, a myth, a morality tale, a parody, a political treatise, even a vision of the apocalypse, <b>Lord of the Flies</b> has established itself as a true classic.<br><br> <br> <br>" },
  { :id => 25, :name => "Chemistry", :subject => nil, :author => "Steven S. Zumdahl, Susan Arena Zumdahl", :edition => nil, :price => nil, :googleId => "LLWkH82PNbYC", :thumbnail => "http://bks1.books.google.com/books?id=LLWkH82PNbYC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE70jL_xadW13sKq-NQ2UDBqIuH-hQUKkpXz6JCRDHQcxbcYs6eVw4JlQ3uvLSGUewZ02eUMfoOyv1xewfiTWf8_r95PIPY_GV8AeIUL5xvbhvX6bnL0&source=gbs_api", :created_at => "2013-11-15 06:08:46", :updated_at => "2013-11-15 06:08:46", :isbn => "0547125321", :published => "2008-12-02", :description => "CHEMISTRY allows the reader to learn chemistry basics quickly and easily by emphasizing a thoughtful approach built on problem solving. For the Eighth Edition, authors Steven and Susan Zumdahl have extended this approach by emphasizing problem-solving str" },
  { :id => 26, :name => "Java The Complete Reference, 8th Edition", :subject => nil, :author => "Herbert Schildt", :edition => nil, :price => nil, :googleId => "NEa5P9rq6RAC", :thumbnail => "http://bks8.books.google.com/books?id=NEa5P9rq6RAC&printsec=frontcover&img=1&zoom=1&imgtk=AFLRE714w5kBJv4l_RVfBA09Gs_6IH8jGYjfvDdis7OwJhzFNpOXLCuO3iQEx9VWoPsIySBlPYWb4IaQlRVwfVtkEblX3062HRvw0CmG44vJHAIofRq3Rh0&source=gbs_api", :created_at => "2013-11-15 06:09:34", :updated_at => "2013-11-15 06:09:34", :isbn => "0071606319", :published => "2011-06-22", :description => "The Definitive Java Programming Guide <p>In <i>Java: The Complete Reference, Eighth Edition</i>, bestselling programming author Herb Schildt shows you everything you need to develop, compile, debug, and run Java programs. Updated for Java Platform, Standard Edition 7 (Java SE 7), this comprehensive volume covers the entire Java language, including its syntax, keywords, and fundamental programming principles. You'll also find information on key elements of the Java API library. JavaBeans, servlets, applets, and Swing are examined and real-world examples demonstrate Java in action. In addition, new Java SE 7 features such as <b>try</b>-with-resources, strings in <b>switch</b>, type inference with the diamond operator, NIO.2, and the Fork/Join Framework are discussed in detail.</p> <p><b>Coverage includes:</b><ul> <li>Data types and operators <li>Control statements <li>Classes and objects <li>Constructors and methods <li>Method overloading and overriding <li>Interfaces and packages <li>Inheritance <li>Exception handling <li>Generics <li>Autoboxing <li>Enumerations <li>Annotations <li>The <b>try</b>-with-resources statement <li>Varargs <li>Multithreading <li>The I/O classes <li>Networking <li>The Collections Framework <li>Applets and servlets <li>JavaBeans <li>AWT and Swing <li>The Concurrent API <li>Much, much more</ul></p>" },
  { :id => 27, :name => "Romeo and Juliet", :subject => nil, :author => "William Shakespeare", :edition => nil, :price => nil, :googleId => "moYNAAAAYAAJ", :thumbnail => "http://bks2.books.google.com/books?id=moYNAAAAYAAJ&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE73XbjOO0aSslzCoUSL0qrtAqcM2jlecELEnU1HKOQdQKrd4BXoYXFG5w50uPNK2mMMonfdAr3kFkYQGmMSc_N3qbmA5BoO49_WzBKd5wFV3RMDhqsM&source=gbs_api", :created_at => "2013-11-15 06:09:46", :updated_at => "2013-11-15 06:09:46", :isbn => nil, :published => "1839", :description => "Performed all over the world, and constantly adapted and reinterpreted in a variety of mediums, Shakespeare’s 1597 tale about the doomed “star-crossed lovers” from enemy families whose tumultuous affair ends in tragedy is one of his best known and most beloved plays. The story of the feuding Montague and Capulet families features the famous balcony scene where the lovers first realize their mutual affection, setting off a series of duels, secret plots, and misunderstandings that eventually leads to one of the most tragic death scenes in all of theater." },
  { :id => 28, :name => "Java For Dummies", :subject => nil, :author => "Barry Burd", :edition => nil, :price => nil, :googleId => "x8BvqSRbR3cC", :thumbnail => "http://bks0.books.google.com/books?id=x8BvqSRbR3cC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE72C5lGyrSOM97-apXURJs7PffHGfhpHbZt2knzXVLp9WyK9prRIgZPS53AJXb_f5jQgeme-6AcnTSbDJHJPapzhD2RY3F22DUL9AoodUSPKl-U30ec&source=gbs_api", :created_at => "2013-11-15 06:14:59", :updated_at => "2013-11-15 06:14:59", :isbn => "1118051068", :published => "2011-03-03", :description => "<b>Start building powerful programs with Java 6—fast!</b><p><b>Get an overview of Java 6 and begin building your own programs</b><p>Even if you're new to Java programming—or to programming in general—you can get up and running on this wildly popular language in a hurry. This book makes it easy! From how to install and run Java to understanding classes and objects and juggling values with arrays and collections, you will get up to speed on the new features of Java 6 in no time.<p><b>Discover how to</b><ul><li>Use object-oriented programming<li>Work with the changes in Java 6 and JDK 6<li>Save time by reusing code<li>Mix Java and Javascript with the new scripting tools<li>Troubleshoot code problems and fix bugs</ul><p><b>All on the bonus CD-ROM</b><ul><li>Custom build of JCreator and all the code files used in the book<li>Bonus chapters not included in the book<li>Trial version of Jindent, WinOne, and NetCaptor freeware</ul><p><b>System Requirements:</b> For details and complete system requirements, see the CD-ROM appendix.<p><b>Note:</b> CD-ROM/DVD and other supplementary materials are not included as part of eBook file." },
  { :id => 29, :name => "The Scarlet Letter", :subject => nil, :author => "Nathaniel Hawthorne, Brenda Wineapple", :edition => nil, :price => nil, :googleId => "2ksS0EimvrYC", :thumbnail => "http://bks0.books.google.com/books?id=2ksS0EimvrYC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE71_yY6KLGDG9mxt9SHq0ftnp1F6g29IxKv2xkan1Q8LCFuMjNPSP3qmENQ0niO0j9ZD_OW7zY9Lll924I61_VIRfEVWJ-PRjJrL9pKcsQ70fKR7PLY&source=gbs_api", :created_at => "2013-11-15 06:15:12", :updated_at => "2013-11-15 06:15:12", :isbn => "1603035168", :published => "2005-09-27", :description => "\"The Scarlet Letter\" is the story of Hester Prynne a young attractive woman who has been convicted of the crime of adultery and has been sentenced to wear a scarlet letter \"A\" sewn to her dress. The novel, which is set in middle 17th century Boston, is a vivid picture of the archaic social beliefs and customs that were indicative of early colonial American life. It is a time in which adultery was not only considered immoral but was a crime, people believed in witches, and extreme puritanical beliefs ruled everyday life. Hawthorne's narrative is a haunting portrait of days long past." },
  { :id => 30, :name => "Java For Dummies Quick Reference", :subject => nil, :author => "Doug Lowe", :edition => nil, :price => nil, :googleId => "eFnV7o8_tqIC", :thumbnail => "http://bks1.books.google.com/books?id=eFnV7o8_tqIC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE72kW-WZYNlBfbQoIssANvwr2Y97W9MH8XUtQsw_kzH4_jy3p_klSaofBCSBVdUM0vZ3t4GEP8ZdODiz8DwcTDxSabJkaL8QGR2HqwNI_SP-AoGWkZQ&source=gbs_api", :created_at => "2013-11-15 06:16:59", :updated_at => "2013-11-15 06:16:59", :isbn => "1118239741", :published => "2012-05-01", :description => "<b>A reference that answers your questions as you move through your coding</b><p>The demand for Android programming and web apps continues to grow at an unprecedented pace and Java is the preferred language for both. <i>Java For Dummies Quick Reference</i> keeps you moving through your coding while you solve a problem, look up a command or syntax, or search for a programming tip. Whether you're a Java newbie or a seasoned user, this fast reference offers you quick access to solutions without requiring that you wade through pages of tutorial material. <ul><li>Leverages the true reference format that is organized with quick answers and solutions so you can read less and do more <li>Offers new elements such as a syntax guide, command guide, special generics and annotation section, and programming tips <li>Boasts a new, compact trim size that easily goes where you go for convenient referencing </ul><p><i>Java For Dummies Quick Reference</i> helps you move quickly and efficiently through Java without missing a beat!</p>" },
  { :id => 31, :name => "Organic Chemistry", :subject => nil, :author => "Jonathan Clayden, Nick Greeves, Stuart Warren", :edition => nil, :price => nil, :googleId => "kQgu2j_ber0C", :thumbnail => "http://bks3.books.google.com/books?id=kQgu2j_ber0C&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE735lo_bibERMZi9x4oPMZHk-CKSu-PaMCCgXJ6CQqpoP3N722rVlj9XfbvowvVZRwy3Zs49m-G9By2C2L9XUozcamLYKM77EMNwljbb6V9OxkWCfUM&source=gbs_api", :created_at => "2013-11-15 06:18:02", :updated_at => "2013-11-15 06:18:02", :isbn => "0199270295", :published => "2012-03-15", :description => "Inspiring and motivating students from the moment it published, Organic Chemistry has established itself in just one edition as the students' choice of organic chemistry text. This second edition takes all that has made Organic Chemistry the book of choice, and has refined and refocused it to produce a text that is even more student-friendly, more coherent and more logical in its presentation than before. At heart, the second edition remains true to the first, being built on three principles: An explanatory approach, through which the reader is motivated to understand the subject and not just learn the facts; A mechanistic approach, giving the reader the power to understand compounds and reactions never previously encountered; An evidence-based approach, setting out clearly how and why reactions happen as they do, giving extra depth to the reader's understanding. The authors write clearly and directly, sharing with the reader their own fascination with the subject, and leading them carefully from topic to topic. Their honest and open narrative flags pitfalls and misconceptions, guiding the reader towards a complete picture of organic chemistry and its universal themes and principles. Enriched with an extensive bank of online resources to help the reader visualise the structure of organic compounds and their reaction mechanisms, this second edition reaffirms the position of Organic Chemistry as the essential course companion for all organic chemistry students. Online Resource Centre For students: A range of problems to accompany each chapter For registered adopters of the text: Figures from the book in electronic format" },
  { :id => 32, :name => "Moby Dick", :subject => nil, :author => "Herman Melville", :edition => nil, :price => nil, :googleId => "XV8XAAAAYAAJ", :thumbnail => "http://bks3.books.google.com/books?id=XV8XAAAAYAAJ&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE70zxF-a17FqvdkIQKGINpQWKR1ZcujRenk_6ZrZhIV8SgxaE208eaLkyoDmQrxuSX4S7vQdh3eC1bwj6oq9zcA877HoH_e3Xra4Qb53Qx70hyouVeo&source=gbs_api", :created_at => "2013-11-15 06:20:44", :updated_at => "2013-11-15 06:20:44", :isbn => nil, :published => "1892", :description => "A literary classic that wasn't recognized for its merits until decades after its publication, Herman Melville's Moby-Dick tells the tale of a whaling ship and its crew, who are carried progressively further out to sea by the fiery Captain Ahab. Obsessed with killing the massive whale, which had previously bitten off Ahab's leg, the seasoned seafarer steers his ship to confront the creature, while the rest of the shipmates, including the young narrator, Ishmael, and the harpoon expert, Queequeg, must contend with their increasingly dire journey. The book invariably lands on any short list of the greatest American novels." },
  { :id => 33, :name => "Effective Java", :subject => nil, :author => "Joshua Bloch", :edition => nil, :price => nil, :googleId => "ka2VUBqHiWkC", :thumbnail => "http://bks4.books.google.com/books?id=ka2VUBqHiWkC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE72dEZelSzX2a0CQKexqE3_ZXU-oXUA-n7Os_UMInryyFt_PEDje3fPaC0lhVzfYIATexcF6_C9TlcQWSXghfYkhXyV2mhLHuj12EranX8ZazYuKOk8&source=gbs_api", :created_at => "2013-11-15 06:21:02", :updated_at => "2013-11-15 06:21:02", :isbn => "0132778041", :published => "2008-05-08", :description => "<b> <p> </b>Are you looking for a deeper understanding of the Java™ programming language so that you can write code that is clearer, more correct, more robust, and more reusable? Look no further! <i> <b> <i>Effective Java™, Second Edition,</i> </b> </i> brings together seventy-eight indispensable programmer’s rules of thumb: working, best-practice solutions for the programming challenges you encounter every day.</p> <p> </p> <p>This highly anticipated new edition of the classic, Jolt Award-winning work has been thoroughly updated to cover Java SE 5 and Java SE 6 features introduced since the first edition. Bloch explores new design patterns and language idioms, showing you how to make the most of features ranging from generics to enums, annotations to autoboxing.</p> <p> </p> <p>Each chapter in the book consists of several “items” presented in the form of a short, standalone essay that provides specific advice, insight into Java platform subtleties, and outstanding code examples. The comprehensive descriptions and explanations for each item illuminate what to do, what not to do, and why.</p> <p> </p> <p>Highlights include: </p> <ul> <li> New coverage of generics, enums, annotations, autoboxing, the for-each loop, varargs, concurrency utilities, and much more <li> Updated techniques and best practices on classic topics, including objects, classes, libraries, methods, and serialization <li> How to avoid the traps and pitfalls of commonly misunderstood subtleties of the language <li> Focus on the language and its most fundamental libraries: java.lang, java.util, and, to a lesser extent, java.util.concurrent and java.io </li> </ul> <p>Simply put, <b> <i> <b>Effective Java™, Second Edition,</b> </i> </b> presents the most practical, authoritative guidelines available for writing efficient, well-designed programs.</p>" },
  { :id => 34, :name => "To Kill a Mockingbird", :subject => nil, :author => "Harper Lee", :edition => nil, :price => nil, :googleId => "0NEbHGREK7cC", :thumbnail => "http://bks7.books.google.com/books?id=0NEbHGREK7cC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE70sXgX3fSTugotrM2tGOQ7vc2HcNIxNCASIhynudOYMR2_DTno8UOR7zmXWLtC82S4Abi0o8R4qFDDloKrRP5_Wa5yIMKn4R-S8Y-8GMdpBHqXkYtE&source=gbs_api", :created_at => "2013-11-15 06:21:25", :updated_at => "2013-11-15 06:21:25", :isbn => "0871299208", :published => "1970", :description => "Harper Lee's classic novel of a lawyer in the Deep South defending a black man charged with the rape of a white girl. One of the best-loved stories of all time, To Kill a Mockingbird has earned many distinctions since its original publication in 1960. It won the Pulitzer Prize, has been translated into more than forty languages, sold more than thirty million copies worldwide, and been made into an enormously popular movie. Most recently, librarians across the country gave the book the highest of honors by voting it the best novel of the twentieth century." },
  { :id => 35, :name => "CMOS VLSI Design", :subject => nil, :author => "Neil Weste, David Harris", :edition => nil, :price => nil, :googleId => "4SYrAAAAQBAJ", :thumbnail => "http://bks0.books.google.com/books?id=4SYrAAAAQBAJ&printsec=frontcover&img=1&zoom=1&imgtk=AFLRE72Luu_rxU32iDMR3YuhfmIJI1As0NQILFCDOCeZpMK-YscnZsh4CDvwIQHTZILesuPLj7EQamg46krR07mCoKNCyHIereMXNkJgRhPuiQWpDBQDfaY&source=gbs_api", :created_at => "2013-11-15 06:21:42", :updated_at => "2013-11-15 06:21:42", :isbn => "0133001474", :published => "2011-11-21", :description => "<p>This is the eBook of the printed book and may not include any media, website access codes, or print supplements that may come packaged with the bound book.</p> <p> <b>For both introductory and advanced courses in VLSI design, this authoritative, comprehensive textbook is highly accessible to beginners, yet offers unparalleled breadth and depth for more experienced readers.</b> </p> <p> <b> </b> </p> <p>The Fourth Edition of <i>CMOS VLSI Design: A Circuits and Systems perspective</i> presents broad and in-depth coverage of the entire field of modern CMOS VLSI Design. The authors draw upon extensive industry and classroom experience to introduce today’s most advanced and effective chip design practices. They present extensively updated coverage of every key element of VLSI design, and illuminate the latest design challenges with 65 nm process examples. This book contains unsurpassed circuit-level coverage, as well as a rich set of problems and worked examples that provide deep practical insight to readers at all levels. </p>" },
  { :id => 36, :name => "Java Programming", :subject => nil, :author => "Joyce  Farrell", :edition => nil, :price => nil, :googleId => "DgH5fzwyxukC", :thumbnail => "http://bks8.books.google.com/books?id=DgH5fzwyxukC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE71UrZnRma2D9rPT4cvKzgHuSMbU3ukxPzH-DIGsp6F24T_JHFlU5n5Bsjq7xOBvppRxDv1t1H5NJUm7y_u9SSeDeTMQ25ALK7RgTMohDEPG_l5-_YM&source=gbs_api", :created_at => "2013-11-15 06:41:40", :updated_at => "2013-11-15 06:41:40", :isbn => "1285081951", :published => "2013-01-31", :description => "Now you can learn to effectively develop applications using today's popular Java programming language with this complete, engaging, and hands-on guide. Farrell's JAVA PROGRAMMING, 7E provides the details and real-world exercises you need to master Java, one of the most widely used tool among professional programmers for building visually interesting GUI and Web-based applications.\n\nWith JAVA PROGRAMMING you can develop useful programs while learning the basic principles of structured and object-oriented programming. You'll find clear explanations and an inviting presentation with real, yet understandable, programming examples and meaningful exercises that reinforce skills. Full programming examples emphasize learning in context. Updated \"You Do It\" sections, all-new programming exercises, and new continuing cases help you build skills that are critical for ongoing programming success. Find everything you need for a solid foundation in Java programming with this proven text and optional accompanying Video Lessons from the text author in the interactive CourseMate." },
  { :id => 37, :name => "Java Programming 24-Hour Trainer", :subject => nil, :author => "Yakov Fain", :edition => nil, :price => nil, :googleId => "4291OT10_ZAC", :thumbnail => "http://bks9.books.google.com/books?id=4291OT10_ZAC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE7325v9RrKwA1fMoVALs4SDKKCQIqRbz1anY8uG_o_QNDPcjLEsJ7h-MKMg7jufggs1-M1VQu9hQqQirliGPi56VsxTvD4TR5wJkC4ZvdQTXS-IZzxY&source=gbs_api", :created_at => "2013-11-15 06:41:54", :updated_at => "2013-11-15 06:41:54", :isbn => "1118058194", :published => "2011-10-12", :description => "<b>A unique book-and-video package presented by Java guru Yakov Fain </b></p><p>As one of the most popular software languages for building Web applications, Java is often the first programming language developers learn. The latest version includes numerous updates that both novice and experienced developers need to know. With this invaluable book-and-video package, Java authority Yakov Fain fully covers Java?s new features as well as its language extensions, classes and class methods, and the Swing Application Framework. For each lesson that he discusses in the book, there is an accompanying instructional video to reinforce your learning experience.</p><p>Lessons include:</p><ul><li>Introducing Java </li><li>Eclipse IDE </li><li>Object-Oriented Programming </li><li>Class Methods</li><li>Back to Java Basics </li><li>Packages, Interfaces, and Encapsulation </li><li>Programming with Abstract Classes and Interfaces</li><li>Introducing the Graphic User Interface</li><li>Event Handling in UI</li><li>Introduction to Java Applets </li><li>Developing a Tic-Tac-Toe Applet </li><li>Developing a Ping-Pong Game </li><li>Error Handling </li><li>Introduction to Collections </li><li>Introduction to Generics </li><li>Working with Streams </li><li>Java Serialization </li><li>Network Programming</li><li>Processing E-Mails with Java </li><li>Introduction to Multi-Threading </li><li>Digging Deeper into Concurrent Execution </li><li>Working with Databases Using JDBC </li><li>Swing with JTable </li><li>Annotations and Reflection </li><li>Remote Method Invocation </li><li>Java EE 6 Overview </li><li>Programming with Servlets </li><li>JavaServer Pages </li><li>Developing Web Applications with JSF </li><li>Introducing JMS and MOM </li><li>Introducing JNDI</li><li>Introduction to Enterprise JavaBeans</li><li>Introduction to the Java Persistence API</li><li>Working with RESTful Web Services</li><li>Introduction to Spring MVC Framework </li><li>Introduction to Hibernate Framework </li><li>Bringing JavaFX to the Mix </li><li>Java Technical Interviews </li></ul><p><b>Note: As part of the print version of this title, video lessons are included on DVD. For e-book versions, video lessons can be accessed at wrox.com using a link provided in the interior of the e-book.</b></p><p>?</p>" },
  { :id => 38, :name => "Java SE 7 Programming Essentials", :subject => nil, :author => "Michael Ernest", :edition => nil, :price => nil, :googleId => "zuGy-V3Nk4AC", :thumbnail => "http://bks7.books.google.com/books?id=zuGy-V3Nk4AC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE73IbEtQ1TyL_XvzfZQksFXRhLdUVQccEhemaj68Bsz0_cB4al9wj1Jl9KUaEs8LARAPa66lwZxnoXHqHSDcTm2UenKqJBCrhMeLQuZTu7ZzH194BD4&source=gbs_api", :created_at => "2013-11-15 06:42:15", :updated_at => "2013-11-15 06:42:15", :isbn => "1118463854", :published => "2012-10-23", :description => "<b>Learn core programming concepts and technologies on the leading software development language</b></p><br><p>This full-color book covers fundamental Java programming concepts and skills for those new to software development and programming. Taking a straightforward and direct approach,<i>Java SE 7 Programming Essentials</i> provides a solid foundational knowledge of programming topics. Each chapter begins with a list of topic areas, and author Michael Ernest provides clear and concise discussion of these core areas. The chapters contain review questions and suggested labs, so the reader can measure their understanding of the chapter topics.</p><br><ul><li> Covers topics such as working with Java data types, using operators and decision constructs, creating and using arrays, and much more<br><li> Includes additional learning tutorials and tools<br><li> Puts the focus on Oracle's new Oracle Certified Associate (OCA): Java SE 7 Programmer (1Z0-803) exam</ul><br><p>This must-have resource offers new programmers a solid understanding of the Java SE 7 programming language.</p>" },
  { :id => 39, :name => "Java Programming: Comprehensive Concepts and Techniques, 3rd ed.", :subject => nil, :author => "Michael L. Mick", :edition => nil, :price => nil, :googleId => "etLVgKNrgEoC", :thumbnail => "http://bks9.books.google.com/books?id=etLVgKNrgEoC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE71XHZCBP-dswXB0KLNt_3Obc_9qYNUfhBogAcGB5x5BTQZflX3j2bswRtSasHEOtIaCYN7q2N9pBayw-FGYazOD04dXrKrZCKrk5ttx1APQgYVjktI&source=gbs_api", :created_at => "2013-11-15 06:42:19", :updated_at => "2013-11-15 06:42:19", :isbn => "1418859850", :published => "2005-09-30", :description => "Part of the highly successful Shelly Cashman Series, this text takes the project-oriented approach to learning introductory Java programming skills. With an emphasis on object-oriented programming concepts and real world examples, this book presents stude" },
  { :id => 40, :name => "Concepts in Programming Languages", :subject => nil, :author => "John C. Mitchell", :edition => nil, :price => nil, :googleId => "7Uh8XGfJbEIC", :thumbnail => "http://bks1.books.google.com/books?id=7Uh8XGfJbEIC&printsec=frontcover&img=1&zoom=1&edge=curl&imgtk=AFLRE70w1SgrNcIaPiU_mX7n99w83wMEcoD5_zP-2RZF0WbXNyIpMJfFXNaV3NUxesb9cV6CYE_wcPCGlz3KVwKa0y_pMwpFPmHaviro_WOE8zRI_RxNkb8&source=gbs_api", :created_at => "2013-11-17 21:55:00", :updated_at => "2013-11-17 21:55:00", :isbn => "1139433482", :published => "2003", :description => "Concepts in Programming Languages elucidates the central concepts used in modern programming languages, such as functions, types, memory management, and control. The book is unique in its comprehensive presentation and comparison of major object-oriented programming languages. Separate chapters examine the history of objects, Simula and Smalltalk, and the prominent languages C++ and Java. The author presents foundational topics, such as lambda calculus and denotational semantics, in an easy-to-read, informal style, focusing on the main insights provided by these theories. Advanced topics include concurrency, concurrent object-oriented programming, program components, and inter-language interoperability. A chapter on logic programming illustrates the importance of specialized programming methods for certain kinds of problems." },
  { :id => 41, :name => "Introduction to the Theory of Computation", :subject => nil, :author => "Michael Sipser", :edition => nil, :price => nil, :googleId => "-RuDtQAACAAJ", :thumbnail => "http://bks2.books.google.com/books?id=-RuDtQAACAAJ&printsec=frontcover&img=1&zoom=1&imgtk=AFLRE72raFXQtnajnjH7HiPM4IeoDkBmY66vm1bqbqx0fYyYXo3kC4aw1wcapwZNdjjWeicaYJrN0GO33pbi-cn1WG6bkek2ypJommEem450srLEOydkJ5o&source=gbs_api", :created_at => "2013-11-17 21:55:16", :updated_at => "2013-11-17 21:55:16", :isbn => "113318779X", :published => "2012-06", :description => "Gain a clear understanding of even the most complex, highly theoretical computational theory topics in the approachable presentation found only in the market-leading INTRODUCTION TO THE THEORY OF COMPUTATION, 3E. The number one choice for today's computational theory course, this revision continues the book's well-know, approachable style with timely revisions, additional practice, and more memorable examples in key areas. A new first-of-its-kind theoretical treatment of deterministic context-free languages is ideal for a better understanding of parsing and LR(k) grammars. You gain a solid understanding of the fundamental mathematical properties of computer hardware, software, and applications with a blend of practical and philosophical coverage and mathematical treatments, including advanced theorems and proofs. INTRODUCTION TO THE THEORY OF COMPUTATION, 3E's comprehensive coverage makes this a valuable reference for your continued studies in theoretical computing." },
